            <div class="flex flex-no-wrap bg-gray-200 overflow-hidden ">
                {ListImage.map(src => (
                    <img class="w-1/3 rounded-lg mx-4" src={src} />
                ))}
            </div>
            <div class="text-center m-5">
                <button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full mx-5 "> {"<-"} </button>
                <button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full"> {"->"} </button>
            </div>
        </>
    )
}

export default index;
